import React from "react";
import styled from "styled-components";

import { ReactSketchCanvas } from "react-sketch-canvas";

const Container = styled.div`
position: absolute:
top: 0;
left: 0;
width: 100vw;
height: 100vh;

`;

export default function Index() {
  return (
    <Container>
      <ReactSketchCanvas canvasColor="transparent" width="100vw" height="100vh" strokeWidth={4} strokeColor="black" />
    </Container>
  );
}
